import "./App.css";
import Login from "./components/Login";
import FarmList from "./components/FarmList";

import {BrowserRouter as Router, Switch, Route} from "react-router-dom";

function App() {
  return (
    <div className="App">
      <Router>
        <Switch>
          {/* farmlist (miniView) */}
          <Route
            exact
            path="/farmlist"
            render={(routeProps) => <FarmList {...routeProps} />}
          />
          <Route
            path="/:any"
            render={(routeProps) => (
              <div style={{}}>
                <h2>404 page not found</h2>
                <button
                  onClick={() => routeProps.history.push("/")}
                  style={{
                    backgroundColor: "white",
                    width: "50px",
                    height: "50px",
                    borderRadius: "10px",
                  }}
                >
                  Go Back
                </button>
              </div>
            )}
          />

          {/* login */}
          <Route
            excat
            path="/"
            render={(routeProps) => <Login {...routeProps} />}
          />
        </Switch>
      </Router>
    </div>
  );
}

export default App;
